export default function ClickCounter(props) {
const {setClickCounter} = props;


    const onClickHandler = () => {
        setClickCounter((perv)=>perv+1)
        console.log("clicked")
    };
    return (
        <button type='button' onClick={onClickHandler}>
            ClickMe
        </button>
    )
}
